import logo from './logo.svg';
import './App.css';

function Header(){
  return <header>
    <h1><a href="/">Endless Creation</a></h1>
  </header>
}

function App() {
  return (
    <div>
      <Header></Header>
      <Header></Header>
      <Header></Header>
      <nav>
        <ul>
          <li><a href="/read/1">Home</a></li>
          <li><a href="/read/2">About Us</a></li>
          <li><a href="/read/3">Members</a></li>
          <li><a href="/read/4">Recruit</a></li>
        </ul>
      </nav>

      <article>
        <h2>Welcome</h2>
        Hello, Web
      </article>

    </div>
  );
}

export default App;
